Hongkong
Actie / Drama
113 minuten


geregisseerd door Dante Lam
met Nicholas Tse, Lunmei Kwai en Yi Lu


Inspecteur Don Lee vertrouwt voor zijn werk in grote mate op informanten. Wanneer een zeer precieze gewapende overvaller de stad terroriseert heeft Don iemand nodig die infiltreert. Zijn keuze valt op straatracer Guy, die hem echter geen concrete informatie kan geven, en zelfs met een nieuwe identiteit het land uit moet vluchten. Don Lee blijft gedesillusioneerd achter in deze wereld vol 
verraad.[/center]


